import React from 'react'
import { Navbar } from './Navbar';

export const Dashboard = ({sidebarToggle, setSidebarToggle}) => {
  return (
  <div className="w-full">
      <Navbar
      sidebarToggle={sidebarToggle} setSidebarToggle={setSidebarToggle}
      />
    </div>
  )
}
